import DateTime from "../NewTask/DateTime";
import "./ConsultantPage.css";
import React from "react";
import taskIcon from "../Asset/taskIcon.png";
import { Routes, Route } from "react-router-dom";
import {useLocation, useNavigate} from "react-router";
import ConsultantOverview from "./ConsultantOverview";
import ConsultantBanner from "./ConsultantBanner";
import PageTitle from "../Handover/PageTitle";
import image from "../Asset/taskIcon.png";

function Consultant() {
  let location= useLocation();
  console.log(location.state);

  let navigate = useNavigate();
  function returnToLogin() {
    navigate("/");
  }

    if (!location.state) {
        return <div>...</div>
    }

  return (
    <div className="Consultant">
      <Routes>
        <Route
          path="/Consultant"
          element={
            <>
                <section>
                    <div id="welcomeBanner">
                        <div id="titleBanner">Hello Dr.{location.state.name}</div>
                        <div id="taskIconW">
                            <DateTime />
                            <img
                                src={image}
                                height={75}
                                alt="taskIcon"
                                id="taskIconImgW"
                            />
                        </div>
                    </div>
                    <button onClick={returnToLogin} style={{float: "right", marginTop: "20px", marginRight: "20px",
                        color: "white", borderColor: "DodgerBlue" ,backgroundColor: "DodgerBlue", borderRadius: "10px" ,
                        padding: "10px"}}> Back to Login  </button>
                </section>
                <PageTitle role="Consultant" />
              <ConsultantOverview/>
            </>
          }
        />
      </Routes>
    </div>
  );
}

export default Consultant;
